Filthy Family 3 - Reality Junkies. So happy together! After seeing her stepsister going at it with her boyfriend, Alexis puts herself out there for the taking. Fed up that everyone is getting action except her, Bree gets what she needs from a friendly neighbor. Carolyn has a burning secret but doesn't know how to break the news. Lucky for Herschel, she makes it real easy on him. Mother Julia doesn't like her stepdaughter's boyfriend one bit. She has a plan to get them out of the house for good. Stepdaughter Rachel shows the girls how a real woman takes care of her man by leaving the door open for educational purposes.
